import { Box, Typography } from "@mui/material";

const Home = () => {
  return (
    <Box sx={{ width: "100%", boxSizing: "border-box" }}>
      <Box
        p={8}
        pt={15}
        minHeight={500}
        display="flex"
        justifyContent="space-between"
      >
        <Box width="45%" border={"1px solid"}>
          1
        </Box>
        <Box
          width="45%"
          display="flex"
          flexDirection="column"
          border={"1px solid"}
          alignItems="center"
          justifyContent="center"
        >
          <Typography>서비스 소개</Typography>
          <Typography>서비스 소개</Typography>
        </Box>
      </Box>
      <Box p={8} minHeight={500} bgcolor="#f5f5f5" display="flex">
        <Box width="50%">1</Box>
        <Box width="50%">2</Box>
      </Box>
    </Box>
  );
};

export default Home;
